import React from 'react';

export const PinIcon = (props) => {
  return (
    <svg width={16} height={24} viewBox="0 0 16 24" {...props}>
      <title>{"iconmonstr-location-1"}</title>
      <defs>
        <filter id="prefix__a">
          <feColorMatrix
            in="SourceGraphic"
            values="0 0 0 0 0.576471 0 0 0 0 0.592157 0 0 0 0 1.000000 0 0 0 1.000000 0"
          />
        </filter>
      </defs>
      <g filter="url(#prefix__a)" fill="none" fillRule="evenodd">
        <path
          d="M8 0C3.802 0 0 3.403 0 7.602 0 11.8 3.469 16.812 8 24c4.531-7.188 8-12.2 8-16.398C16 3.403 12.199 0 8 0zm0 11a3 3 0 110-6 3 3 0 010 6z"
          fill='#9397FF'
          fillRule="nonzero"
        />
      </g>
    </svg>
  );
};
